import React, { useState, useEffect } from "react";
import { Row, Col, Container } from "react-bootstrap";
import {FcLink} from "react-icons/fc"
import Navigation from "../Component/Navigation"
import Footer from "./Footer";

const GetApi = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch(
      "https://newsapi.org/v2/top-headlines?country=in&category=technology&apiKey=8ca20aaf2abd4cff9514090a0251731a",
      { method: "GET" }
    )
      .then((arrypromic) => {
        //console.log(apipromic)
        return arrypromic.json();
      })
      .then((apidata) => {
        setData(apidata.articles);
      });
  }, []);

  console.log(data);

  return (
    <>
      <Row>
       
       <Navigation />
      </Row>
      <Row>
        <Col>
        {data.map((key) => {
            return (
              <>
              <Container className="mt-5 api-container">
                <Row className="pt-3 pb-3">
                  {/* img col */}
                 <Col> <img src={key.urlToImage} style={{ width: 500 }} /></Col>
                 {/* text content col */}
                 <Col>
                 <Row><Col className="source-text">{key.source.name}</Col></Row>
                 <Row className="mt-3 title-text"><Col>{key.title}</Col></Row>
                 <Row><p>{key.description}</p></Row>
                 <Row><Col>{key.content}</Col></Row>
                 <Row className="mt-2"><Col>Date: {key.publishedAt}</Col>
                 <Col>Link <a href={key.url} ><FcLink style={{fontSize: 40}} /></a></Col></Row>
                 </Col>
                </Row>
                </Container>
              </>
            );
          })}
        </Col>
       
      </Row>
      <Row className="mt-5"><Footer /></Row>
    </>
  );
};
export default GetApi;
